function o2Linkage(r){
	var $th = this;
	$th.R = $.extend({selects:[]},r || {});
	/* 一些不能初始化的静态变量 */
	$th.R = $.extend($th.R,{hasP:false,hasC:false,hasT:false}); 
	/* 定义成员函数 */ 
	$th.packP = function(val){
		if(!val) val='';
		var html = '';
		for(var i=0; i<$th.P.length; i++){
			var temp = $th.P[i].split('|');
			var slt = '';
			if(temp[1] == val) slt=' selected="selected" ';
			html += '<option value="'+temp[1]+'" '+slt+' >'+temp[1]+'</option>';
		}
		$('#'+$th.R.selects[0].id).html(html);	
	};
	$th.packC = function(val){
		if(!val) val='';
		/* 恢复城市区域option */
		var html = '';
		for(var i=0; i<$th.C[$('#'+$th.R.selects[0].id).get(0).selectedIndex].length; i++){
			var temp = $th.C[$('#'+$th.R.selects[0].id).get(0).selectedIndex][i].split('|');
			var slt = '';
			if(temp[1] == val) slt=' selected="selected" ';
			html += '<option value="'+temp[1]+'" '+slt+' >'+temp[1]+'</option>';
		}
		$('#'+$th.R.selects[1].id).html(html);
	};
	$th.packT = function(val){
		if(!val) val='';
		var html = '';
		for(var i=0; i<$th.T[$('#'+$th.R.selects[0].id).get(0).selectedIndex][$('#'+$th.R.selects[1].id).get(0).selectedIndex].length; i++){
			var temp = $th.T[$('#'+$th.R.selects[0].id).get(0).selectedIndex][$('#'+$th.R.selects[1].id).get(0).selectedIndex][i].split('|');
			var slt = '';
			if(temp[1] == val) slt=' selected="selected" ';
			html += '<option value="'+temp[1]+'" '+slt+' >'+temp[1]+'</option>';
		}
		$('#'+$th.R.selects[2].id).html(html);
	};
	
	$th.run = function(){
		if($th.R.hasC){
			$('#'+$th.R.selects[0].id).bind('change',function(e){
				$th.packC();
				if($th.R.hasT){
					$th.packT();
				}
			});	
		};
		if($th.R.hasT){
			$('#'+$th.R.selects[1].id).bind('change',function(e){
				$th.packT();
			});
		}
	};
	/* 组装省份select */
	if($th.R.selects[0]){
		$th.R.hasP = true;
		$th.R.selects[0] = $.extend({id:'',val:''},$th.R.selects[0]);
		$('#'+$th.R.selects[0].id).html('');
	};
	/* 组装城市select */
	if($th.R.selects[1]){
		$th.R.hasC = true;
		$th.R.selects[1] = $.extend({id:'',val:''},$th.R.selects[1]);
		$('#'+$th.R.selects[1].id).html('');
	}; 
	/* 组装区域select */
	if($th.R.selects[2]){
		$th.R.hasT = true;
		$th.R.selects[2] = $.extend({id:'',val:''},$th.R.selects[2]);
		$('#'+$th.R.selects[2].id).html('');
	};
	/* 启动 */
	if($th.R.hasP){
		$th.packP($th.R.selects[0].val);
		$('#'+$th.R.selects[0].id).css('width',$('#'+$th.R.selects[0].id).css('width'));
	};
	if($th.R.hasC){
		$th.packC($th.R.selects[1].val);
		$('#'+$th.R.selects[1].id).css('width',$('#'+$th.R.selects[1].id).css('width'));
	};
	if($th.R.hasT){
		$th.packT($th.R.selects[2].val);
		$('#'+$th.R.selects[2].id).css('width',$('#'+$th.R.selects[2].id).css('width'));
	};
	$th.run();
};
